import React from 'react';
import {Link} from 'react-router-dom';

function Header() {
  return (
    <div>
     <Link to="/">Home</Link> | <Link to="/products">Products</Link> | <Link to="/cart">Cart</Link>
     </div>
  )
}

export default Header;
